INSERT INTO `v1_21f11ceacc5caa550a5c038ee2bdd5588c9d701af6097f8ba5770bf031dbc166` VALUES (150, 1, 0, 8, 40001, 37, "ぺコリーヌ", 1, 91002, 107501, "今日は記念日、お祝いですね！\n焼肉、お寿司、ピザ、ケーキ～☆\nあなたとパーティできるなんて、\n幸せです～♪");
INSERT INTO `v1_21f11ceacc5caa550a5c038ee2bdd5588c9d701af6097f8ba5770bf031dbc166` VALUES (150, 1, 0, 8, 40001, 38, "コッコロ", 2, 91002, 107601, "この記念日を迎えられたのは、\n主さまの器量の賜物\nさすがは主さまでございます\nえらい、えらい♪");
INSERT INTO `v1_21f11ceacc5caa550a5c038ee2bdd5588c9d701af6097f8ba5770bf031dbc166` VALUES (150, 1, 0, 8, 40001, 39, "キャル", 3, 91002, 107801, "あんたもけっこうやるじゃない！\nちょっとは…割と…け、けっこう\n見直しちゃったわ\n褒めてあげる♪");
INSERT INTO `v1_21f11ceacc5caa550a5c038ee2bdd5588c9d701af6097f8ba5770bf031dbc166` VALUES (150, 1, 0, 8, 40001, 40, "スズメ", 4, 91002, 107701, "あなたと私にとって、\n今日は特別な日\nあなたの支えがあるから、\n私は頑張れるんです！");
INSERT INTO `v1_21f11ceacc5caa550a5c038ee2bdd5588c9d701af6097f8ba5770bf031dbc166` VALUES (150, 1, 0, 8, 40001, 41, "タマキ", 5, 91002, 107901, "今日はキミにとっての\n特別な記念日だにゃ\nキミの活躍にはいつも\n猫ながら感謝してるにゃ～♪");
INSERT INTO `v1_21f11ceacc5caa550a5c038ee2bdd5588c9d701af6097f8ba5770bf031dbc166` VALUES (150, 2, 0, 8, 40001, 42, "ぺコリーヌ", 6, 91002, 107501, "う～かき氷食べ過ぎて、\n身体が冷えちゃいました…\nあなたの体温で温めてください！\nギューーッ♪");
INSERT INTO `v1_21f11ceacc5caa550a5c038ee2bdd5588c9d701af6097f8ba5770bf031dbc166` VALUES (150, 2, 0, 8, 40001, 43, "コッコロ", 7, 91002, 107601, "夏は危険がいっぱいと申します…\nですが、わたくしが主さまを\nしっかりとお守りいたしますよ");
INSERT INTO `v1_21f11ceacc5caa550a5c038ee2bdd5588c9d701af6097f8ba5770bf031dbc166` VALUES (150, 2, 0, 8, 40001, 44, "キャル", 8, 91002, 107801, "ん～なんであんたと、ひと夏を\n過ごすことになったのかな…\n結構楽しいからいいけど！\nさ、まだまだ遊ぶわよ！");
INSERT INTO `v1_21f11ceacc5caa550a5c038ee2bdd5588c9d701af6097f8ba5770bf031dbc166` VALUES (150, 2, 0, 8, 40001, 45, "スズメ", 9, 91002, 107701, "あなたと過ごすはじめての夏…\nいまからドキドキが止まりません\n楽しくて素敵な思い出が、\nまた一つ増えるんですね♪");
INSERT INTO `v1_21f11ceacc5caa550a5c038ee2bdd5588c9d701af6097f8ba5770bf031dbc166` VALUES (150, 2, 0, 8, 40001, 46, "タマキ", 10, 91002, 107901, "夏は一番の稼ぎ時にゃのに、\n今年はキミと過ごしたいって\n思ってるにゃ楽しい思い出\n増やしてくれるかにゃ？");
